import Dialog from "./components/Dialogs/Dialogs";

const App = () => {
    return (
        <div className='app-wrapper'>
            <Header />
            <Navbar />
            <div className='content'>
                {/*<Profile />*/}
                <Dialog />
            </div>
        </div>
    );
}

export default App;
